<div id='myDiv'><!-- Plotly chart will be drawn inside this DIV --></div>

	<script>

// open this by  https://codepen.io/pen
// https://plotly.com/javascript/colorscales/
// colorschemes from ggmsa at http://yulab-smu.top/ggmsa/articles/guides/Color_schemes_And_Font_Families.html
	
window.data = [];
window.layout = {};

function plot_jump_to_x(e){
	var xstart = 0;
	var xend=0;
	var xrange = window.layout.xaxis.range;
	xrange_unit = xrange[1]-xrange[0]; // 计算xaxis的range长度
	
	if(e == 1){ // msa坐标
		console.log(window.layout.xaxis.range);
		xstart = document.getElementById("jump_pos_start").value; // 输入感兴趣的区域在msa中起始点坐标
	}else if(e == 2){ // template序列的实际坐标
		xstart = document.getElementById("jump_pos_start2").value; // 输入感兴趣的区域在msa中起始点坐标
		xstart = pos_from_seq_to_msa[xstart];
	}else{
		alert("error: not support plot_jump_to_x for"+e);
	}
	
	xstart = xstart -0.5-1;
	xend = xstart + xrange_unit;
	window.layout.xaxis.range = [xstart, xend];
	Plotly.relayout('myDiv', window.layout);

}

function clear_msa(){
	document.getElementById("msa").value = "";
}

function plot_msa(){
	// read msa fasta
	var msa_str = document.getElementById("msa").value;
	var msa = read_fasta(msa_str);
	
	
	
	// 定义color
	var colorscale = generate_colorscale("clustal");
	var the_colorscale = colorscale['config'];

	
	//自定义template
	var pseq_name_list = Object.keys(msa);
	if(pseq_name_list.length == 0){
		alert("error: msa is null ?");
	}
	var template_pid = pseq_name_list[0]; // 暂时定义第一条序列作为msa的template
	var y_len = pseq_name_list.length;
	var x_lens = [];
	var pfa_dict = {};
	var p_index = 0;
	var template_seq = "";
	var pseq_name_list = [];
	var pos_from_seq_to_msa = {};
	
	for([key, val] of Object.entries(msa)) {
		var pid=key;
		var pseq=val;
		if (pid == template_pid){
			if(template_seq == ""){
				template_seq = pseq;
				if(pfa_dict.hasOwnProperty(y_len-1)){
					alert("error: y_len-1=" + y_len-1 + " had exist!")
				}else{
					pfa_dict[y_len-1] = pseq;
				}
			}else{
				alert("error: get two template_pid="+template_pid+" ?");
			}
		
		}else if(!pfa_dict.hasOwnProperty(p_index)){
			pfa_dict[p_index] = pseq;
			pseq_name_list.push(pid);
			p_index += 1;

		}else{
			alert("error: bug here");
		}
		if (! x_lens.includes(pseq.length)){
			x_lens.push(pseq.length);
		}
	}


	

	// 检查msa序列长度是否一致
	if(x_lens.length != 1){
		console.log(msa);
		console.log(x_lens);
		alert("error: x_lens.length="+x_lens.length);
	}
	
	
	pseq_name_list.push(template_pid); // template_pid 作为msa matrix的第一行！
	var ytickval = [...Array(y_len).keys()];
	
	// msa每个位点的top频率
	consensus_maxfreq_list = [];
	if(template_seq==""){
		alert("error: template_seq is null!");
	}
	
	// 定义 pos_from_seq_to_msa
	for(var i=0; i< template_seq.length; i++){
		var real_i = template_seq.slice(0,i+1).replaceAll("-", "").length
		if(pos_from_seq_to_msa.hasOwnProperty(real_i)){continue}
		pos_from_seq_to_msa[real_i] = i;
	}
	
	
	var msapos = [...Array(template_seq.length).keys()];
	for (var i=0; i < msapos.length; i++){
		var base_column_dict = {};
		var total = y_len;
		var max_count = 0;
		ytickval.forEach((j) => {
			var base = pfa_dict[j][i];
			if(base == "-"){return }; // return in ForEach mean continue!
				
			if(! base_column_dict.hasOwnProperty(base)){
				base_column_dict[base] = 0;
			};
			base_column_dict[base] +=1;
			if(base_column_dict[base] > max_count){
				max_count = base_column_dict[base];
			};
			
			
		});	
		consensus_maxfreq_list.push(max_count/total);

	}
	
	// msa matrix中每个cell对应的z值(for heatmap color) 
	var xlist = [];
	var ylist = [];
	var zlist = [];
	var text_list = [];
	var template_x_list = [];
	ytickval.forEach((y) => {
		var z_line = [];
		msapos.forEach((x) => {
			xlist.push(x);
			ylist.push(y);
			var text = pfa_dict[y][x];
			text_list.push(text);
			
		    var z = get_z_for_colorscale(text, colorscale);
			z_line.push(z);
			var template_x = get_template_x(x, template_seq);
			template_x_list.push(template_x);

		});
		zlist.push(z_line);

	});
	

	
	// output
	var res = {};
	res['x'] = xlist;
	res['y'] = ylist;
	res['z'] = zlist;
	res['text'] = text_list;
	res['template_x'] = template_x_list;
	res['msa_len'] = x_lens[0];
	res['the_colorscale'] = the_colorscale;
	res['consensus_maxfreq_list'] = consensus_maxfreq_list;
	res['pseq_name_list'] = pseq_name_list;
	res['ytickval'] = ytickval;
	res['template_pid'] = template_pid;
	res['pos_from_seq_to_msa'] = pos_from_seq_to_msa;
	window.pos_from_seq_to_msa = pos_from_seq_to_msa;

	console.log("res:");
	console.log(res);
	
	// start plot now!
	window.data, window.layout = plot_msa_by_plotlyjs(res);
	
	
	console.log("msa:");
	console.log(msa);
}

function get_template_x(x, template_seq){ // x is 0-based
 return template_seq.slice(0, x+1).replaceAll("-", "").length ;
}
function get_z_for_colorscale(text, colorscale){
    if (text == "-"){ text = "Gap"};
    if(! colorscale['z'].hasOwnProperty(text)){
		alert("error: text="+text+" not in colorscale"+colorscale);
        //sys.exit(1)
	}
    return colorscale['z'][text];

}

function generate_colorscale(scheme){
	if(scheme == "clustal"){
		var the_colors = {
"A": 'orange',
"B": '#fff',
"C": 'green',
"D": 'red',
"E": 'red',
"F": 'blue',
"G": 'orange',
"H": 'red',
"I": 'green',
"J": '#fff',
"K": 'red',
"L": 'green',
"M": 'green',
"N": '#fff',
"O": '#fff',
"P": 'orange',
"Q": '#fff',
"R": 'red',
"S": 'orange',
"T": 'orange',
"U": '#fff',
"V": 'green',
"W": 'blue',
"X": '#fff',
"Y": 'blue',
"Z": '#fff',
"Gap": '#fff'
};
		var colorscale = {};
		colorscale['z'] = {};
		colorscale['config'] = [];
		var col_keys = Object.keys(the_colors);
		var color_size = col_keys.length;
		var col_index = 0;
		var rgs = region_by_n(0, 1 ,color_size);
		rgs.forEach((e)=>{
			var start = e[0];
			var end=e[1];
			var z = (start+end)/2;
			var base = col_keys[col_index];
			colorscale['z'][base] = z;
			var col = the_colors[base];
			colorscale['config'].push([start, col]);
			colorscale['config'].push([end, col]);
			col_index ++;


		});
		
		
	}else{
		alert("error: not support scheme="+scheme+" !");
	}
	
	return colorscale;
}

function region_by_n(s,e,n){
	var res = [];
	var step = (e-s)/n;
	for(var i=0; i< n; i++){
		var start = i * step;
		var end = (i +1) * step;
		res.push([start,end]);
	}
	return res;
}

function read_fasta(lines){
	var res = {};
	//var lines="\n>c1\nATCT\nACASTE\n>c2\nsdtattt\nsd\nstat\n>c3\ndat\nsdtsdt\ndstst\n\n";
	var lines_arr = lines.replace(/^\s*/, "").split(/\n>/); //  ['>c1\nATCT\nACASTE', 'c2\nsdtattt\nsd\nstatn>c3\ndat\nsdtsdt\ndstst\n\n']
	if(! lines_arr[0].split(/\n/)[0].match(/^>.*/)){ 
		alert("error: should start with > "+lines_arr[0]);
		return res;
	}else{
		lines_arr[0] = lines_arr[0].replace(/^>/, "");
	}
	
	for(var i=0; i < lines_arr.length; i++){
		var e = lines_arr[i];
		var e_arr = e.split(/\n/);
		//console.log(e_arr);
		if(e_arr.length < 2){
			console.log("skip "+e);
			continue;
		}
		var cid=e_arr[0];
		var cseq=e_arr.slice(1).join("").replace(/\s/g, "");
		if(!( cid.match(/.*\S.*/) )){
			alert("error:"+e);
			return res;
		}
		if(!( cseq.match(/\S+/) )){
			alert("error:"+e);
			return res;
		}
		res[cid] = cseq;
		
	}
	//console.log(res);
	return res;
}
